Quadrilateral $ABCD$ is a square, and segment $AE$ is perpendicular to segment $ED$. If $AE = 8$ units and $DE = 6$ units, what is the area of pentagon $AEDCB$, in square units? [asy]
size(150);
pair A, B, C, D, E;
A=(0,10);
B=(0,0);
C=(10,0);
D=(10,10);
E=(6.4,5.2);
draw(A--B--C--D--A);
draw(A--E--D);
label("A", A, NW);
label("B", B, SW);
label("C", C, SE);
label("D", D, NE);
label("E", E, S);
[/asy]

On the 5 by 5 square grid below, each dot is 1 cm from its nearest horizontal and vertical neighbors. What is the product of the value of the area of square $ABCD$ (in cm$^2$) and the value of the perimeter of square $ABCD$ (in cm)? Express your answer in simplest radical form.

[asy]unitsize(1cm);
defaultpen(linewidth(0.7));
dot((0,0));
dot((0,1));
dot((0,2));
dot((0,3));
dot((0,4));
dot((1,0));
dot((1,1));
dot((1,2));
dot((1,3));
dot((1,4));
dot((2,0));
dot((2,1));
dot((2,2));
dot((2,3));
dot((2,4));
dot((3,0));
dot((3,1));
dot((3,2));
dot((3,3));
dot((3,4));
dot((4,0));
dot((4,1));
dot((4,2));
dot((4,3));
dot((4,4));
draw((0,3)--(3,4)--(4,1)--(1,0)--cycle);
label("$A$",(3,4),N);
label("$B$",(4,1),E);
label("$C$",(1,0),S);
label("$D$",(0,3),W);
[/asy]

Note that when we say the grid is 5 by 5 we mean that each row and column contains 5 dots!

The sides of this parallelogram measure 7,9, $8y-1$ and $2x+3$ units, consecutively. What is the value of $x+y$?

[asy]draw((0,0)--(21,0)--(30,25)--(9,25)--cycle);
label("$8y-1$",(10,0),S);
label("9",(25.5,12.5),E);
label("7",(19.5,25),N);
label("$2x+3$",(4.5,12.5),W);
[/asy]

Three coplanar circles intersect as shown. What is the maximum number of points on the circles that a line passing through all three circles can touch?

[asy]import graph;
draw(Circle((-9,9),15));
draw(Circle((0,-9),15));
draw(Circle((9,9),15));
[/asy]

Two circles have the same center O. Point X is the midpoint of segment OP. What is the ratio of the area of the circle with radius OX to the area of the circle with radius OP? Express your answer as a common fraction.

[asy]
import graph;
draw(Circle((0,0),20));
draw(Circle((0,0),12));
dot((0,0));
dot((20,0));
dot((12,0));
draw((0,0)--(20,0));
label("$O$",(0,0),SE);
label("$P$",(20,0),E);
label("$X$",(12,0),SE);
[/asy]

An equilateral triangle and a square are inscribed in a circle as shown. $ABC$ is isosceles. The triangle and square share a common vertex. What is the number of degrees in the measure of the angle indicated by the question mark?

[asy]

import markers; defaultpen(linewidth(0.8));

pair A,B,C,D,E,F,G;

draw(unitcircle);

A=(-1,0);
B=(0,-1);
C=(1,0);
D=(0,1);

draw(A--B--C--D--A);

E=(-0.9,-0.45);
F=(0.9,-0.45);

draw(D--E--F--D);

G=(-0.76,-0.23);

markangle(Label("?"),n=1,radius=10,D,G,A,marker(stickframe(n=0),true));

label("$A$",(-0.5,-0.34));
label("$B$",(0.5,-0.34));
label("$C$",B,S);

[/asy]

In Perfectville, the streets are all $20$ feet wide and the blocks they enclose are all squares of side length $400$ feet, as shown.  Sarah runs around the block on the $400$-foot side of the street, while Sam runs on the opposite side of the street.  How many more feet than Sarah does Sam run for every lap around the block?

[asy]
draw((0,0)--(10,0));
draw((1,1)--(9,1));
draw((0,0)--(0,10));
draw((0,10)--(10,10));
draw((10,10)--(10,0));
draw((9,1)--(9,9));
draw((9,9)--(1,9));
draw((1,9)--(1,1));
fill((1,1)--(1,9)--(9,9)--(9,1)--cycle,gray);
draw((9,10.5)--(9,11));
draw((10,10.5)--(10,11));
draw((9,10.75)--(10,10.75));
label("20'",(9.5,11),N);
draw((10.5,9)--(11,9));
draw((10.5,10)--(11,10));
draw((10.75,9)--(10.75,10));
label("20'",(11,9.5),E);
label("400'",(5,9),S);
label("400'",(9,5),W);
[/asy]

In the diagram, $PQR$ is a straight line.  What is the value of $x$?

[asy]
draw((-2,0)--(8,0),linewidth(0.7)); draw((8,0)--(5,-5.5)--(0,0),linewidth(0.7));
label("$P$",(-2,0),W); label("$Q$",(0,0),N); label("$R$",(8,0),E); label("$S$",(5,-5.5),S);

label("$136^\circ$",(0,0),SW); label("$64^\circ$",(7,0),S);

label("$x^\circ$",(5,-4.5));

[/asy]

What is the number of degrees in $x$? [asy]
import olympiad; import geometry; defaultpen(linewidth(0.8)); size(150);
pair A = origin, B = (Cos(50),Sin(50)), C = (Cos(50) + Sin(50)*sqrt(3),0);
draw(A--B--C--cycle);
label("$30^\circ$",C-(0.3,-.03),NW);
label("$2x$",B + (-.10,-0.1),SE);
label("$x$",A+(0.15,.03),NE);
[/asy]
